values:
Back from AZ. it was fun,.. I ofically have one day to go to school, then one day of finals, then one more day of finals. I can' t even contain myself right now.&nbsp; Josh picked me up from the airport that was nice:)&nbsp; even though i slept (drooled? maybe?) on the way home.&nbsp; I am going to cut my hair short this weekend. I want to go to a new hair place though, because last time I was in there&nbsp;1) it was 90$.&nbsp; 2)the guy i thought was gay wasn't gay. 3) my hairstylist just recently developed a case of bad breath, and sometimes gets these deoderant marks all over that bug me for some reason.&nbsp; Any ideas?!&nbsp;

i have a lot to do these next few days.&nbsp;&nbsp;
life is really happy right now and comfortable.&nbsp; Sometimes being comfortable is good.&nbsp;&nbsp;

mackenzie is a chipppppppmunk. or was. that made me laugh.&nbsp;&nbsp;&nbsp;


uhm, Arizona was gorgeous.&nbsp; I decided that the only thing i don't like is having to drive five bajillion hours to get somewhere. ASU campus was sweet.&nbsp; I really like cacti (as in more than one cactus) ((i think thats right)).&nbsp;&nbsp;


summer is so close.&nbsp; ....&nbsp;&nbsp;&nbsp;&nbsp; ..... .... .... ... .. .. .. . .&nbsp;

i leave for flordia in a week. gross? cool? undecided. all i know is my roomies are: shara, katie trautman, katie kenealy, jordan, and me.&nbsp; oh god.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; hilarious........&nbsp;&nbsp;

also, i slept all day.&nbsp;&nbsp;

and i dont think this is racist but this really old dirty (and by dirty i mean perverted child molester esque.) mexican man followed me in the airport yesterday. he even got the same pop and resses that i did. gross.
